Beavis and Butt-Head - Season 9 (2011) - HDTV 720p

DESCRIPTION: Beavis and Butt-head is an American animated television series created by Mike Judge with Texas tie-ins to Judge's later show, King of the Hill. The series originated from Frog Baseball, a 1992 short film by Judge. After seeing the short, MTV signed Judge to develop the concept. Beavis and Butt-head originally aired from March 8, 1993 to November 28, 1997. 

The series was revived in 2011 and new episodes began airing on MTV on October 27, 2011. The series has retained a cult following.

